const Videos = ({ video }) => {
    return (  
        <ul>
            {video.map(video => {
                return (
                    <li key={video.name}>
                        <h1> { video.name } </h1>
                        <p>Views: {video.views}</p>
                        <p>Likes: {video.likes}</p>
                    </li>
                )
            })}
        </ul>
    );
}
 
export default Videos;
